import { SIGN_IN, SIGN_OUT } from "./types";

export const signIn = (id) => {
  return {
    type: SIGN_IN,
    payload: { id: id },
  };
};

export const signOut = (id) => {
  return {
    type: SIGN_OUT,
  };
};
